\f0\fs20 \cf0 Equalizer is an open source programming interface and resource management system for 
\f1\i parallel, scalable
\f0\i0  OpenGL applications. An Equalizer application can run unmodified on any visualization system, from a singlepipe workstation to large scale graphics clusters and shared memory visualization systems. The foundation of Equalizer is a 
\f1\i minimally invasive
\f0\i0  programming interface which addresses the problems common to any multipipe application.}
